description:
Bán nhà phố Trường Chinh. Diện tích 90m2, 5 tầng, mặt tiền 4m. Giá 17 tỷ thương lượng.
SIÊU PHẨM TRUNG TÂM ĐỐNG ĐA - LÔ GÓC - NGÕ THÔNG - KINH DOANH - Ô TÔ - Ô CHỜ THANG MÁY 
- Tầng 1: Cho thuê kinh doanh, để xe.
- Tầng lửng: Bếp ăn;
- Tầng 2: Phòng Khách rộng, wc và 1 phòng ngủ;
- Tầng 3: 03 phòng ngủ, 1wc;
- Tầng 4: 03 ngủ khép kín;
- Tầng 5: 02 ngủ khép kín và phòng thờ.
Tất cả các tầng đếu có bán công.
Sổ nở hậu đẹp, sẵn sàng giao dịch.
- Liên hệ Em Dũng để xem nhà và nhận tư vấn, lọc nhà phù hợp cho anh chị nhé. Với danh sách hơn 16,000 căn, bất động sản đẹp toàn nội thành Hà Nội để anh chị lựa.
- Anh chị có bất động sản cần bán liên hệ em có khách mua sớm luôn.
